import React from "react";
import Card from "../UI/Card";
import classes from "./Login.module.css";
const LoginPage = () =>{
 
 return(
    <React.Fragment>
        <Card>    
            <h1 className={classes.header_pos}>SIGN IN</h1>
                <form action="Login/Authenticate" method="Post" className= {classes.form_test}>
                    <div className="input_container">
                        <input type="text" className={classes.username, classes.focus} placeholder="Username"></input>
                        <input type="text" className={classes.password} placeholder="password"></input>
                    </div>  
                    <button className={classes['btn-login']}>Sign In</button>
                </form>
         </Card>       
    </React.Fragment>
        )
}

export default LoginPage;
